        const colors = {"KELP": "#8FD3F4", "SQUID_INK": "#7EB6FF", "RAINFOREST_RESIN": "#90D4C5", "JAMS": "#FFC47E", "CROISSANTS": "#FF9A8B", "DJEMBES": "#D4A5A5", "PICNIC_BASKET1": "#9E8FB2", "PICNIC_BASKET2": "#A1A6FF", "VOLCANIC_ROCK": "#FF6B6B", "VOLCANIC_ROCK_VOUCHER_9500": "#4ECDC4", "VOLCANIC_ROCK_VOUCHER_9750": "#45B7D1", "VOLCANIC_ROCK_VOUCHER_10000": "#FFB900", "VOLCANIC_ROCK_VOUCHER_10250": "#98DDCA", "VOLCANIC_ROCK_VOUCHER_10500": "#FF8B94", "MAGNIFICENT_MACARONS": "#FFB480", "transportFees": "#B0C4DE", "exportTariff": "#F0FFF0", "importTariff": "#E0FFFF", "sugarPrice": "#FFDAB9", "sunlightIndex": "#FFB6C1"};
        
        // 保存所有曲线的引用
        let allTraces = {};
        
        // 创建图表
        function initializeChart() {
            const productData = {};
            const layout = {
                title: '',
                showlegend: false,
                plot_bgcolor: 'white',
                paper_bgcolor: 'white',
                font: {color: '#333'},
                margin: {l: 60, r: 30, t: 30, b: 60},
                xaxis: {
                    title: 'Timestamp',
                    ticktext: ['Day 2', 'Day 3', 'Day 4'],
                    tickvals: [0, 1000000, 2000000],
                    gridcolor: '#eee',
                    gridwidth: 1,
                    color: '#333'
                },
                yaxis: {
                    title: 'Price / Value',
                    gridcolor: '#eee',
                    color: '#333',
                    tickformat: '.0f'
                },
                hovermode: 'x unified',
                dragmode: 'zoom',
                uirevision: 'true'
            };
            
            // 创建初始空图表
            Plotly.newPlot('chart', [], layout, {
                responsive: true,
                displayModeBar: true,
                modeBarButtonsToAdd: ['toggleSpikelines', 'hovercompare', 'hoverclosest'],
                modeBarButtonsToRemove: ['lasso2d', 'select2d']
            });
            
            // 创建每个产品的按钮
            const productSelector = document.getElementById('product-selector');
            
            Object.keys(rawData).forEach(product => {
                const button = document.createElement('button');
                button.className = 'product-btn active';
                button.textContent = product;
                button.setAttribute('data-product', product);
                button.style.borderLeft = '4px solid ' + (colors[product] || '#808080');
                button.addEventListener('click', toggleProduct);
                productSelector.appendChild(button);
                
                // 添加产品曲线到图表
                addProductToChart(product);
            });
        }
        
        // 添加产品曲线到图表
        function addProductToChart(product) {
            const data = rawData[product];
            
            const trace = {
                x: data.x,
                y: data.y,
                name: product,
                type: 'scatter',
                mode: 'lines',
                line: {
                    color: colors[product] || '#808080',
                    width: 2
                },
                hovertemplate: product + '<br>Time: %{x}<br>Value: %{y:.2f}<extra></extra>'
            };
            
            allTraces[product] = trace;
            Plotly.addTraces('chart', trace);
        }
        
        // 切换产品显示状态
        function toggleProduct(event) {
            const button = event.target;
            const product = button.getAttribute('data-product');
            
            button.classList.toggle('active');
            
            updateVisibleTraces();
        }
        
        // 根据所选分类和产品更新图表
        function updateVisibleTraces() {
            const activeCategory = document.querySelector('.category-btn.active').getAttribute('data-category');
            const activeProducts = Array.from(document.querySelectorAll('.product-btn.active')).map(
                btn => btn.getAttribute('data-product')
            );
            
            // 创建新的数据数组
            const traces = [];
            
            Object.keys(allTraces).forEach(product => {
                // 检查产品是否应该显示（基于类别和单独选择）
                const productCategory = categoryMap[product];
                const shouldShow = (
                    activeProducts.includes(product) && 
                    (activeCategory === 'all' || productCategory === activeCategory)
                );
                
                if (shouldShow) {
                    traces.push(allTraces[product]);
                }
            });
            
            // 更新图表
            Plotly.react('chart', traces, {}, {
                responsive: true,
                uirevision: 'true'
            });
        }
        
        // 切换产品类别
        document.querySelectorAll('.category-btn').forEach(button => {
            button.addEventListener('click', function() {
                // 移除其他按钮的active类
                document.querySelectorAll('.category-btn').forEach(btn => {
                    btn.classList.remove('active');
                });
                
                // 添加active类到当前按钮
                this.classList.add('active');
                
                // 更新产品按钮状态
                const category = this.getAttribute('data-category');
                document.querySelectorAll('.product-btn').forEach(btn => {
                    const product = btn.getAttribute('data-product');
                    const productCategory = categoryMap[product];
                    
                    if (category === 'all' || productCategory === category) {
                        btn.style.display = 'inline-block';
                    } else {
                        btn.style.display = 'none';
                    }
                });
                
                // 更新图表
                updateVisibleTraces();
            });
        });
        
        // 初始化图表
        initializeChart();
    </script>
